import React from "react";
import { SHOP_DATA } from "./shoppage.data";
import "./shoppage.styles.scss";
import previewCollection from "../../components/previewCollection/previewCollection.component";

export default class Shop extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      shopData: SHOP_DATA,
    };
  }

  render() {
    return (
      <div className="shop-page">
        {console.log(this.state.shopData)};
        {this.state.shopData.map(({ title, ...data }) => (
          <previewCollection title={title} item={data}></previewCollection>
        ))}
      </div>
    );
  }
}
